INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 91002, 1, 0, 37, 150, 8, 40001, 107501, "ぺコリーヌ", 1);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 91002, 2, 0, 38, 150, 8, 40001, 107601, "コッコロ", 1);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 91002, 3, 0, 39, 150, 8, 40001, 107801, "キャル", 1);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 91002, 4, 0, 40, 150, 8, 40001, 107701, "スズメ", 1);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 91002, 5, 0, 41, 150, 8, 40001, 107901, "タマキ", 1);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 91002, 6, 0, 42, 150, 8, 40001, 107501, "ぺコリーヌ", 2);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 91002, 7, 0, 43, 150, 8, 40001, 107601, "コッコロ", 2);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 91002, 8, 0, 44, 150, 8, 40001, 107801, "キャル", 2);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 91002, 9, 0, 45, 150, 8, 40001, 107701, "スズメ", 2);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES ("夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 91002, 10, 0, 46, 150, 8, 40001, 107901, "タマキ", 2);
